window.bookSummaryJSON = "<p>Star Force is called to arms again! <i>Outcast</i> is a new beginning, the first book in a new spin-off series. </p> <p>Many peaceful years have passed since the Macro Wars ended. Most of those who fought against the heartless machines have aged - but not the ingenious artificial construct known as Marvin. His insatiable curiosity is as strong as ever, and he’s brought home fresh perils to humanity’s doorstep. </p> <p>The new Saga in the Star Force universe begins with <i>Outcast</i>, the longest book in the series. A full-length novel of military science fiction by best-selling authors B. V. Larson and David VanDyke.</p>"; 
